import React, { Component } from 'react';

class Name extends Component {
  render() {

    const { value, handleChange } = this.props;

    return (
      <label htmlFor="name">
        Nome:
        <input
          type="text"
          name="name"
          id="name"
          value={value}
          onChange={handleChange}
        />
      </label>
    );
  }
}

export default Name;
